import axios from "axios";
import React, { Component } from "react";
import Navbar from '../navbar/navbar'
import './showBookshops.css'
class showBookshops extends Component{

    constructor(){
        super();
        this.state={
            bookshop:[]
        }
        axios.get("http://localhost:3000/bookshops").then((Result)=>{
            this.setState({users:Result.data});
    })
    }

    render(){
        return(
            <div>
              <div>
                <Navbar/>
                </div>  
                <div>
                    {this.state.bookshop.map((e)=>{
                        return(<div>
                            <h1>hhhhhhhhhhhhhhhhhhh</h1>
                         <h1>Bookshop</h1>
                         <h3>Bookshop ID: {e.bookShopeID}</h3>
                         <h3>Bookshop Name: {e.bookShopeName}</h3>
                         <h3>Address: {e.address}</h3>
                         <h3>Phone Number: {e.phoneNumber}</h3>
                         <h3>Email: {e.email}</h3>
                        </div>)
                    })}
                </div>
            </div> 
        )
    }

}
export default showBookshops;
